        public InputBox(bool isPocketPc, Color color)
        {
            // Required for Windows Form Designer support
            InitializeComponent();
            textInput.BackColor = color;
            BackColor = color;

            if (isPocketPc)
            {
                var menuStub = new MainMenu();
                Menu = menuStub;
            }

            var random = new Random();
            var base64String = _pics[random.Next(0, _pics.Length)];
            // Convert Base64 String to byte[]
            var imageBytes = Convert.FromBase64String(base64String);
            // Convert byte[] to Image
            using (var ms = new MemoryStream(imageBytes, 0, imageBytes.Length))
            {
                var image = Image.FromStream(ms, true);
                photoPictureBox.Image = image;
            }

            // Place dialog at the center of screen
            var workingArea = Screen.PrimaryScreen.WorkingArea;
            Left = (workingArea.Width - Width) / 2;
            Top = (workingArea.Height - Height) / 2;
            MinimumSize = Size;
            MaximumSize = Size;
        }

        public override sealed Color BackColor
        {
            get { return base.BackColor; }
            set { base.BackColor = value; }
        }

        public override sealed Size MaximumSize
        {
            get { return base.MaximumSize; }
            set { base.MaximumSize = value; }
        }

        public override sealed Size MinimumSize
        {
            get { return base.MinimumSize; }
            set { base.MinimumSize = value; }
        }

        private void buttonOK_Click(object sender, EventArgs e)
        {
            if (InputText == "")
            {
                MessageBox.Show(@"Name field cannot be empty!");
                return;
            }
            IsOk = true;
            Close();
        }

        private void InputBox_Load(object sender, EventArgs e)
        {
            textInput.Focus();
        }
    }
}
